import styled from "styled-components";
import {Link} from 'react-router-dom'

export const CardLink = styled(Link)`
color : #fff;
display: flex;
flex-direction: row;
text-decoration : none;
padding : 0 1rem;
cursor : pointer;

&:hover{
    text-decoration-line: none;
}

`

export const CardTitle = styled.h2`
font-size: 1.2rem;
color:#fff;
font-family: 'Raleway';
font-weight: 600;
`
